import React from 'react';
import Autocomplete from "../entry/AutoComplete";
import './account.css';
import Popup from "reactjs-popup";

class DailyExpense extends React.Component {
	state = {
		todos: []
	}
	componentDidMount() {
		fetch('http://127.0.0.1:8000/list-of-dailyexpense/')
		.then(res => res.json())
		.then((data) => {
		this.setState({ todos: data })
		})
	}
	render() {
		return (
			<div>	
				<table className="table table-borderd">
						<thead className="thead-dark">
							<tr>
								<th>Category</th>
								<th>Date</th>
								<th>Debit Amount</th>
								<th>Remark</th>
							</tr>
						</thead>
						<tbody>
							{this.state.todos.map((todo) => (
								<tr>
									<td>{todo.category}</td>
									<td>{todo.date}</td>
									<td>{todo.debit_amount}</td>
									<td>{todo.remark}</td>
								</tr>
							))}
						</tbody>
					</table>
			</div>
		);
	}
}
export default DailyExpense;
